  `company_id` bigint NOT NULL,
  `cb_id` smallint NOT NULL,
  `cb_pos_id` smallint NOT NULL,
  `tr_date` date NOT NULL,
  `tr_number` varchar(16) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
