  `buysell_id` bigint DEFAULT NULL,
  `buysell_payment_type` smallint DEFAULT NULL,
  `status` smallint NOT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `createdby` smallint DEFAULT NULL,
  `updatedby` smallint DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=730 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=COMPACT;

