/*Table structure for table `dttot` */

DROP TABLE IF EXISTS `dttot`;

CREATE TABLE `dttot` (
  `nama` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `deskripsi` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `terduga` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `kode_densus` varchar(35) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `tpt_lahir` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `tgl_lahir` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `warga_negara` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `alamat` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
