  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `createdby` bigint DEFAULT NULL,
  `updatedby` bigint DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

