/*Table structure for table `kurs_bi` */

DROP TABLE IF EXISTS `kurs_bi`;

CREATE TABLE `kurs_bi` (
  `id` smallint NOT NULL,
  `valas_id` smallint DEFAULT NULL,
  `kurs_year` decimal(4,0) DEFAULT NULL,
  `kurs_month` decimal(2,0) DEFAULT NULL,
  `middle_rate` decimal(12,3) DEFAULT '0.000',
  `status` smallint DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `createdby` smallint DEFAULT NULL,
  `updatedby` smallint DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_rate` (`valas_id`,`kurs_year`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

/*Data for the table `kurs_bi` */

/*Table structure for table `kurs_daily` */

