  `rate_sale` decimal(12,3) DEFAULT '0.000',
  `difference_sale` decimal(12,3) DEFAULT '0.000',
  `price_buy_bot` decimal(12,3) DEFAULT '0.000',
  `price_buy_top` decimal(12,3) DEFAULT '0.000',
  `price_sale_bot` decimal(12,3) DEFAULT '0.000',
  `price_sale_top` decimal(12,3) DEFAULT '0.000',
  `status` smallint DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `createdby` smallint DEFAULT NULL,
  `updatedby` smallint DEFAULT NULL,
  PRIMARY KEY (`id`,`valas_id`,`rate_date`) USING BTREE,
  KEY `idx_rate` (`id`,`valas_id`,`rate_date`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

