/*Table structure for table `tr_bayar` */

DROP TABLE IF EXISTS `tr_bayar`;

CREATE TABLE `tr_bayar` (
  `id` bigint DEFAULT NULL,
  `company_id` smallint NOT NULL,
  `tr_id` smallint NOT NULL,
  `tr_number` varchar(14) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `tr_date` date NOT NULL,
  `payment_type` smallint NOT NULL,
  `amount` decimal(18,3) DEFAULT NULL,
  `description` varchar(150) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
  `status` smallint DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `createdby` smallint DEFAULT NULL,
  `updatedby` smallint DEFAULT NULL,
  KEY `idx_transfer` (`tr_id`,`tr_number`,`tr_date`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 ROW_FORMAT=COMPACT;

